import { margin } from "@mui/system";
import React from "react";
import './App.css';
import { LastSeq } from "./LastSeq";
import NewSelect from './NewSelect';
import Typography from '@mui/material/Typography';

function App() {
    document.title = "Greensoftweb"

    return (
        <div>
            <header className={'App-header fst-italic fs-1 fw-bold bg-white'}>
                Greensoft
            </header>
            <div id="block1">
            <Typography sx={{ mt: 3,  ml:5 }} variant="h6" component="div">
            Text only
          </Typography>
            <LastSeq />  
            </div>
            <div id = "block2">
            <Typography sx={{ mt: 2,  ml:5, mb:1 }} variant="h6" component="div">
            Text only
          </Typography>
            <NewSelect /> 
            </div>
        </div>
    );
}

export default App;
